export const onlyText = "<p>width」プロパティだけで、「height」プロパティを特に指定していない場合は、内容がボックスからはみ出さないように、ボックスは縦に伸張します。</p><p><br></p><p><br></p><p><br></p><h2>値（hidden）</h2><p>「overflow:hidden;」とした場合、ボックスから内容がはみ出た場合、その部分は表示されません。</p><p><br></p><p><br></p><p><br></p><h2>値（scroll）</h2><p>「overflow:scroll;」とした場合、ボックスのサイズは変わりませんが、要素の縦横にスクロールバーが表示されて、全体が見られるようになります。</p><p><br></p><p><br></p><p><br></p><h2>値（auto）</h2><p>「overflow:auto;」とした場合の表示方法は「全体が見られるようにすべきである」という曖昧な指定だけで、実際の挙動はブラウザに任されています。</p><p><br></p><p><br></p><h3>nternetExplorerに不具合あり</h3><p>InternetExplorerでは、「width」プロパティと「height」プロパティを指定しているボックスでも、内容がはみ出さずに、要素の高さが伸びてしまう既知のバグがあります。</p><p>詳しくは以下を参照してください。</p>";

